ue,\"enableFullScreen\":false,\"showScorePoints\":true},\"overallFeedback\":[{\"from\":0,\"to\":100,\"feedback\":\"You got @score of @total points\"}],\"grabbablePrefix\":\"Grabbable {num} of {total}.\",\"grabbableSuffix\":\"Placed in dropzone {num}.\",\"dropzonePrefix\":\"Dropzone {num} of {total}.\",\"noDropzone\":\"No dropzone.\",\"tipLabel\":\"Show tip.\",\"tipAvailable\":\"Tip available\",\"correctAnswer\":\"Correct answer\",\"wrongAnswer\":\"Wrong answer\",\"feedbackHeader\":\"Feedback\",\"scoreBarLabel\":\"You got :num out of :total points\",\"scoreExplanationButtonLabel\":\"Show score explanation\",\"localize\":{\"fullscreen\":\"Fullscreen\",\"exitFullscreen\":\"Exit fullscreen\"},\"a11yCheck\":\"Check the answers. The responses will be marked as correct, incorrect, or unanswered.\",\"a11yRetry\":\"Retry the task. Reset all responses and start the task over again.\",\"submit\":\"Submit\"},\"library\":\"H5P.DragQuestion 1.14\",\"subContentId\":\"dbf02932-aea1-43d4-abda-206f50d3d831\",\"metadata\":{\"contentType\":\"Drag and Drop\",\"license\":\"U\",\"title\":\"Drag and Drop\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Drag and Drop\"}},\"useSeparator\":\"auto\"},{\"content\":{\"params\":{\"answers\":[{\"correct\":true,\"tipsAndFeedback\":{\"tip\":\"\",\"chosenFeedback\":\"<div>Yes, correct!</div>\\n\",\"notChosenFeedback\":\"\"},\"text\":\"<div>are external traits that distinguish the male from the female.</div>\\n\"},{\"correct\":false,\"tipsAndFeedback\":{\"tip\":\"\",\"chosenFeedback\":\"<div>The reproductive system is made up of organs that have specific functions in the production of reproductive cells, and in the development of the offspring. This is not the case with the mane, antlers or wattles... try another answer.</div>\\n\",\"notChosenFeedback\":\"\"},\"text\":\"<div>are part of the reproductive system.</div>\\n\"},{\"correct\":false,\"tipsAndFeedback\":{\"tip\":\"\",\"chosenFeedback\":\"<div>Even though they are not part of the reproductive system, you will see in the next section that they are useful in attracting a mate. So they are used by males in what is called courtship, which is the stage preceding reproduction.</div>\\n\",\"notChosenFeedback\":\"\"},\"text\":\"<div>are useless in the reproductive process.</div>\\n\"}],\"UI\":{\"checkAnswerButton\":\"Check\",\"showSolutionButton\":\"Show solution\",\"tryAgainButton\":\"Retry\",\"tipsLabel\":\"Show tip\",\"scoreBarLabel\":\"Score\",\"tipAvailable\":\"Tip available\",\"feedbackAvailable\":\"Feedback available\",\"readFeedback\":\"Read feedback\",\"wrongAnswer\":\"Wrong answer\",\"correctAnswer\":\"Correct answer\",\"shouldCheck\":\"Should have been checked\",\"shouldNotCheck\":\"Should not have been checked\",\"noInput\":\"Please answer before viewing the solution\",\"a11yCheck\":\"Check the answers. The responses will be marked as correct, incorrect, or unanswered.\",\"a11yShowSolution\":\"Show the solution. The task will be marked with its correct solution.\",\"a11yRetry\":\"Retry the task. Reset all responses and start the task over again.\",\"submitAnswerButton\":\"Submit\"},\"behaviour\":{\"enableRetry\":true,\"enableSolutionsButton\":true,\"type\":\"auto\",\"singlePoint\":false,\"randomAnswers\":true,\"showSolutionsRequiresInput\":true,\"confirmCheckDialog\":false,\"confirmRetryDialog\":false,\"autoCheck\":false,\"passPercentage\":100,\"enableCheckButton\":true,\"showScorePoints\":true},\"confirmCheck\":{\"header\":\"Finish ?\",\"body\":\"Are you sure you wish to finish ?\",\"cancelLabel\":\"Cancel\",\"confirmLabel\":\"Finish\"},\"confirmRetry\":{\"header\":\"Retry ?\",\"body\":\"Are you sure you wish to retry ?\",\"cancelLabel\":\"Cancel\",\"confirmLabel\":\"Confirm\"},\"question\":\"<p><strong>Activity 5- </strong>Answer the following 2 questions by choosing the right answer.</p>\\n\\n<p>The mane, wattles, antlers etc.</p>\\n\",\"overallFeedback\":[{\"from\":0,\"to\":100,\"feedback\":\"You got @score of @total points\"}],\"media\":{\"disableImageZooming\":false}},\"library\":\"H5P.MultiChoice 1.16\",\"subContentId\":\"163623ee-1e3a-4ba8-818f-f234a5343658\",\"metadata\":{\"contentType\":\"Multiple Choice\",\"license\":\"U\",\"title\":\"Activity 5 - Answer the following 2 questions by choosing the right answer.The mane, wattles, antlers etc.\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Activity 5 - Answer the following 2 questions by choosing the right answer.The mane, wattles, antlers etc.\"}},\"useSeparator\":\"auto\"},{\"content\":{\"params\":{\"answers\":[{\"correct\":false,\"tipsAndFeedback\":{\"chosenFeedback\":\"<div>Primary sexual characteristics are the sex organs that are part of the reproductive system. </div>\\n\",\"tip\":\"\",\"notChosenFeedback\":\"\"},\"text\":\"<div>Primary sexual characteristics</div>\\n\"},{\"correct\":true,\"tipsAndFeedback\":{\"chosenFeedback\":\"<div>Exact! The lion's mane, the deer's antlers, the peacock long and colorful tail, the bright colors and flashy features are external characteristics that help to differentiate males from females and are usually used to attract a mate. They are called secondary characteristics.</div>\\n\",\"notChosenFeedback\":\"\",\"tip\":\"\"},\"text\":\"<div>Secondary sexual characteristics</div>\\n\"},{\"correct\":false,\"tipsAndFeedback\":{\"chosenFeedback\":\"<div>Sex organs are what we call primary sexual characteristics. A sex organ is a part of the body that is involved in sexual reproduction and is part of the reproductive system. The lion's mane, the deer's antlers, the rooster's comb and wattles, the bright colors and flashy features are used to attract a mate.</div>\\n\",\"tip\":\"\",\"notChosenFeedback\":\"\"},\"text\":\"<div>Sex organs</div>\\n\"}],\"UI\":{\"checkAnswerButton\":\"Check\",\"showSolutionButton\":\"Show solution\",\"tryAgainButton\":\"Retry\",\"tipsLabel\":\"Show tip\",\"scoreBarLabel\":\"Score\",\"tipAvailable\":\"Tip available\",\"feedbackAvailable\":\"Feedback available\",\"readFeedback\":\"Read feedback  A) and birds, <strong>males are relatively larger than females</strong>, size may vary with the weight and the health condition of the animal. </p>\\n\"},\"library\":\"H5P.Text 1.1\",\"subContentId\":\"05b41b77-cf96-464b-bfbf-4a69332a26bd\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},{\"params\":{\"text\":\"<p>3- On the other hand, in some birds (specially birds of prey), and most reptiles (other than lizards and crocodilians), amphibians, insects and spiders (document B), <strong>females are larger than males</strong>.</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"subContentId\":\"c4a9e15f-d431-419d-a38c-0dda674ff8d4\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},{\"params\":{\"text\":\"<p>4- The best way to determine the sex of an animal is to examine its external sex organs.</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"subContentId\":\"a6a3fa6e-e086-4842-bae1-89f409cf1e45\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}}],\"helpTextLabel\":\"More information\",\"helpText\":\"\"},\"library\":\"H5P.StandardPage 1.5\",\"subContentId\":\"2f8b6c26-4c13-46af-96fb-a0a16b6c19d3\",\"metadata\":{\"contentType\":\"Standard page\",\"license\":\"U\",\"title\":\"Click for the answers\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Click for the answers\"}}],\"i10n\":{\"previousLabel\":\"Previous\",\"nextLabel\":\"Next\",\"closeLabel\":\"Close\"}},\"library\":\"H5P.DocumentationTool 1.8\",\"subContentId\":\"ae737f1d-55f7-44a0-8297-81722371869f\",\"metadata\":{\"title\":\"Documentation tool\",\"license\":\"U\",\"contentType\":\"Documentation Tool\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Documentation tool\"}},\"useSeparator\":\"auto\"}]}","library":"H5P.Column 1.15","contentUrl":".","metadata":{"license":"CC BY-NC-ND","title":"A &quot;He&quot; or a &quot;She&quot;?","
